import styles from "./Header.module.css";

const links = [
  {
    id: 1,
    item: "Home",
    link: "#home",
  },
  {
    id: 2,
    item: "Ab",
  },
];

export default function Header() {
  return (
    <header>
      <div className={styles.logo_div}>
        <img alt="simba_talents_logo" />
      </div>
      <div className={styles.links_div}>
        <Links />
      </div>
      <h3>Header</h3>
    </header>
  );
}

function Links() {
  return (
    <ul>
      <Link />
    </ul>
  );
}

function Link() {
  return <li>Home</li>;
}
